import React from 'react';
import socials from '../../Socials';
import styled from 'styled-components';
import ModularSummit from '../../assets/modularSummit.webp';
import ModularMeetup from '../../assets/modularMeetup.webp';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowRight } from '@fortawesome/free-solid-svg-icons';

const Container = styled.section`
  padding: 2em 1.5em;

  h2 {
    font-size: 2em;
    font-family: Ruberoid;
    letter-spacing: 0.2px;
    line-height: 1.2em;
    margin-bottom: 1em;
  }

  p {
    font-weight: 200;
    letter-spacing: 0.2px;
    font-size: 0.9em;
    margin-bottom: 2em;
  }

  @media (min-width: 768px) {
    padding: 3em 4em;

    h2 {
      font-size: 3em;
    }

    p {
      font-size: 1.1em;
    }
  }
`;

const Slider = styled.div`
  display: flex;
  flex-direction: column;
  gap: 1.5em;
  overflow-x: auto;
  overflow-y: hidden;

  @media (min-width: 768px) {
    flex-direction: row;
    gap: 2em;
  }
`;

const SocialsContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 1em;
  border: 1px solid #d9d5df;
  border-radius: 6px;
  padding: 2em 1em;
  max-width: 100vw;

  @media (min-width: 768px) {
    flex-wrap: nowrap;
    padding: 3em 2em;
    min-width: 45%;
  }
`;

const SocialContainer = styled.a`
  display: flex;
  flex-direction: column;
  gap: 1.5em;
  align-items: center;
  width: 100%;
  text-decoration: none;
  color: inherit;
  text-align: center;

  h3 {
    font-family: Ruberoid;
    font-size: 1em;
  }

  p {
    font-size: 0.8em;
  }

  @media (min-width: 768px) {
    flex-direction: row;
    gap: 2em;

    h3 {
      font-size: 1.2em;
    }

    p {
      font-size: 1em;
    }
  }
`;

const Logo = styled.img`
  width: 20%;
  height: auto;

  @media (min-width: 768px) {
    width: 15%;
  }
`;

const ArrowSpan = styled(FontAwesomeIcon)`
  color: #7b2bf9;
  transform: rotate(-45deg);
`;

const More = styled.div`
  text-align: right;
  margin-top: 1em;
  width: 100%;

  p {
    font-family: Ruberoid;
    font-weight: 600;
    font-size: 0.9em;
  }

  &:hover {
    p {
      color: #7b2bf9;
    }

    .hoverIcon {
      transform: rotate(0deg);
    }
  }

  @media (min-width: 768px) {
    p {
      font-size: 1em;
    }
  }
`;

const ImageContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 1em;
  overflow-x: auto;

  img {
    width: 80%;
    border-radius: 5px;
    flex-shrink: 0; 
  }

  @media (min-width: 768px) {
    overflow: visible;

    img {
      height: 100%;
      width: 100%;
    }
  }
`;

const ImageSubContainer = styled.div`
  position: relative;

  p {
    font-family: Ruberoid;
    font-weight: 600;
    font-size: 0.8em;
  }
`;

const ImageDesc = styled.p`
  position: absolute;
  top: 85%;
  left: 5%;
  color: white;
  padding: 0.5em 1em;
  background-color: #6c757d;
  border-radius: 5em;
  font-size: 0.8em;

  @media (min-width: 768px) {
    font-size: 1em;
  }
`;

function Landing4() {
  return (
    <Container>
      <h2>Join the community</h2>
      <p>Join the Celestia community online or hang out at one of the grassroots Modular Meetups</p>
      <Slider>
        <SocialsContainer>
          {socials.map((social) => (
            <SocialContainer target="_blank" href={social.link} key={social.social}>
              <Logo src={social.icon} alt={social.logo} />
              <div>
                <h3>{social.social}</h3>
                <p>{social.slogan}</p>
              </div>
            </SocialContainer>
          ))}
          <More>
            <p>
              Find more <ArrowSpan icon={faArrowRight} className="hoverIcon" />
            </p>
          </More>
        </SocialsContainer>
        <ImageContainer>
          <ImageSubContainer>
            <ImageDesc>Modular Summit 2023</ImageDesc>
            <img src={ModularSummit} alt="Modular Summit" />
          </ImageSubContainer>
          <ImageSubContainer>
            <ImageDesc>Modular Meetup</ImageDesc>
            <img src={ModularMeetup} alt="Modular Meetup" />
          </ImageSubContainer>
        </ImageContainer>
      </Slider>
    </Container>
  );
}

export default Landing4;
